import React, { useState } from "react";

const ItemsList = () => {
  const [items, setItems] = useState([
    { name: "Cell Phone", id: 1 },
    { name: "Laptops", id: 2 },
    { name: "Tablets", id: 3 }
  ]);

  return (
    <div className="item-list">
      <ul></ul>
    </div>
  );
};

export default ItemsList;
